import "./ExpensesTotal.css";
import Card from "./Card";

const ExpensesTotal = (props) => {
  const totalAmount = props.expenses.reduce(
    (addAmount, currentValue) => (addAmount = addAmount + currentValue.amount),
    0
  );
  console.log(props.expenses.amount);

  return (
    <Card className="expenseTotal-item">
      <div className="expenseTotal-price">
        <div className="expense-item__price">{totalAmount}</div>
      </div>
    </Card>
  );
};

export default ExpensesTotal;
